import { Component, OnInit } from '@angular/core';
import { AngularFirestore } from '@angular/fire/compat/firestore';
import { getMedicamentByName, getMedicaments } from 'src/firebaseConfig';


interface MedicamentDD {
  class: string;
  conditionnement: string;
  conservation: string;
  amm: string;
  dateamm: string;
  dci: string;
  dosage: string;
  forme: string;
  indication: string;
  laboratoire: string;
  sousclass: string;
  specialite: string;
  specification: string;
  tableau: string;
}

@Component({
  selector: 'app-recherche-medicament',
  templateUrl: './recherche-medicament.page.html',
  styleUrls: ['./recherche-medicament.page.scss'],
})
export class RechercheMedicamentPage implements OnInit {



  medicaments: MedicamentDD[] = [];
  nom: string = '';

  constructor(private firestore: AngularFirestore) { }

   ngOnInit() {
     this.getMedicament()
    console.log(this.getMedicament)
  }

  async fetchMedicament() {
    try {
      if (this.nom) {
        const medicaments = await getMedicamentByName(this.firestore, this.nom);
        console.log('Médecins disponibles :', medicaments);
      } else {
        console.error('Paramètres de recherche non valides.');
        // Ajoutez une logique pour afficher un message à l'utilisateur, si nécessaire
        // Par exemple, utilisez une alerte ou un autre mécanisme pour informer l'utilisateur
        // d'entrer des paramètres valides pour la recherche.
      }
    } catch (error) {
      console.error('Erreur lors de la récupération du medicament (fetchMedicament):', error);
    }
  }
  async getMedicament(){
    const medicaments =await getMedicaments(this.firestore)

      this.medicaments=medicaments;

  }


}
<ion-header [translucent]="true">
  <ion-toolbar>

    <ion-button routerLink="/tabs/tab3" fill="clear"> Retour</ion-button>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-grid>
    <ion-row>
      <ion-col>
  <ion-item class="entier">
    <ion-icon name="search-outline" class="warning"></ion-icon>
    <ion-input placeholder="&nbsp;Nom" type="text" name="nom" [(ngModel)]="nom" >

    </ion-input>
  </ion-item>
</ion-col>

  <ion-col size="auto">
    <ion-button (click)="fetchMedicament()"> 
      <ion-icon name="search-outline"></ion-icon>
    </ion-button>
  </ion-col>
</ion-row>
</ion-grid>

<div *ngIf="medicaments && medicaments.length > 0">
  <ion-grid>
    <ion-row>
      <ion-col>Class</ion-col>
      <ion-col>Conditionnement</ion-col>
      <ion-col>Conservation</ion-col>
      <ion-col>AMM</ion-col>
      <ion-col>Date AMM</ion-col>
      <ion-col>DCI</ion-col>
      <ion-col>Dosage</ion-col>
      <ion-col>Forme</ion-col>
      <ion-col>Indication</ion-col>
      <ion-col>Laboratoire</ion-col>
      <ion-col>Sous-class</ion-col>
      <ion-col>Spécialité</ion-col>
      <ion-col>Spécification</ion-col>
      <ion-col>Tableau</ion-col>
    </ion-row>
    <ion-row *ngFor="let med of medicaments">
      <ion-col>{{ med.class }}</ion-col>
      <ion-col>{{ med.conditionnement }}</ion-col>
      <ion-col>{{ med.conservation }}</ion-col>
      <ion-col>{{ med.amm }}</ion-col>
      <ion-col>{{ med.dateamm }}</ion-col>
      <ion-col>{{ med.dci }}</ion-col>
      <ion-col>{{ med.dosage }}</ion-col>
      <ion-col>{{ med.forme }}</ion-col>
      <ion-col>{{ med.indication }}</ion-col>
      <ion-col>{{ med.laboratoire }}</ion-col>
      <ion-col>{{ med.sousclass }}</ion-col>
      <ion-col>{{ med.specialite }}</ion-col>
      <ion-col>{{ med.specification }}</ion-col>
      <ion-col>{{ med.tableau }}</ion-col>
    </ion-row>
  </ion-grid>
</div>
<div *ngIf="medicaments && medicaments.length === 0">
  <p>Aucun médicament trouvé.</p>
</div>


</ion-content>
